import './App.css';

interface Note {
  id: string,
  title: string,
  text: string,
  color: string,
  date: string
}

function App() {
  const [notes, setNotes] = useState<Note[]>([{
    id: (new Date).toString(),
    title: "Meetings",
    text: "Schedule meeting with team",
    color: "dfdfdf",
    date: (new Date).toString()
  }])

  return (
    <div className="App">
      App
    </div>
  );
}

export default App;
